import './App.css';

function App() {
	return (
		<div className="App">
			<div className="text-box">
				<div className="text-input">
					<input
						type="text"
						className="input "
						placeholder="Type something..."
					></input>
				</div>
			</div>
		</div>
	);
}

export default App;
